function User() {
    return(

        <div class="sidebar">
        <h2>User Portal</h2>
        <a href="#home"><i class="fa fa-fw fa-home"></i> Home</a>
        <a href="#services"><i class="fa fa-fw fa-wrench"></i> Book Search</a>
        <a href="#clients"><i class="fa fa-fw fa-user"></i> Return Book</a>
        <a href="#contact"><i class="fa fa-fw fa-envelope"></i> Please Order</a>
      </div>
    );
}
export default User;
